import React, { Component } from 'react'
import {Navbar, Nav, Container} from 'react-bootstrap'
import light from './light.png'
import logout from './logout.png'
import menu from './menu.png'
import styles from './header.module.css';
import SideMenu from '../SideMenu/SideMenu'

const AuthenticatedMenu = ({ isAuthenticated, toggleMenu, toggleTheme, darkMode, name, isSideMenuOpen  }) => {
  console.log("AuthenticatedMenu: isSideMenuOpen:", isSideMenuOpen);
  console.log("AuthenticatedMenu: toggleMenu:", toggleMenu);
  return (
    <>
      <Navbar expand="lg" className={`${styles.menu_gradient} navbar-transparent p-0`}>
        <Container>
          <Nav className='w-100 d-flex justify-content-between align-items-center'>

            <Nav.Item>
              <Nav.Link href="#">
              <button className="open-btn" onClick={toggleMenu}>
                  <img src={menu} width="25" height="25" alt="Menu Icon" loading="lazy" />
                </button>
              </Nav.Link>
            </Nav.Item>

            <Nav.Item>
              <Nav.Link href="/profile">
                <p> {name}</p>
              </Nav.Link>
            </Nav.Item>

            <Nav.Item>
              <Nav.Link href="#">
                <p style={{ fontWeight: 'bold', fontSize: '20px' }}>еДиплом</p>
              </Nav.Link>
            </Nav.Item>

            <Nav.Item>
              <Nav.Link href="#">
                <img src={light} onClick={toggleTheme} width="25" height="25" alt="Icon" loading="lazy" />
              </Nav.Link>
            </Nav.Item>

            <Nav.Item>
              <Nav.Link href="/">
                <img src={logout} width="25" height="25" alt="Icon" loading="lazy" />
              </Nav.Link>
            </Nav.Item>

          </Nav>
        </Container>
      </Navbar>
      <SideMenu toggleMenu={toggleMenu} isSideMenuOpen={isSideMenuOpen} />
    </>
  );
};

// Компонент для неавторизованных пользователей
const UnauthenticatedMenu = ({isAuthenticated, toggleTheme, darkMode  }) => {
  console.log("AuthenticatedMenu: isSideMenuOpen:", isSideMenuOpen);
  console.log("AuthenticatedMenu: toggleMenu:", toggleMenu);
  return (
    <>
    <Navbar expand="lg" variant="light" className={`${styles.menu_gradient} navbar-transparent p-0`}>
          <Container>
            <Nav className='w-100 d-flex justify-content-between align-items-center'>
              <Nav.Item>
                <Nav.Link href="#">
                  <p>Нужна помощь?</p>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="#">
                  <p style={{ fontWeight: 'bold', fontSize: '20px' }}>еДиплом</p>
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link href="#">
                  <img src={light} onClick={toggleTheme} width="25" height="25" alt="Icon" loading="lazy" />
                </Nav.Link>
              </Nav.Item>
            </Nav>
          </Container>
        </Navbar>
            </>
  );
};

const Header = ({ isAuthenticated, toggleMenu, isSideMenuOpen, toggleTheme, name }) => {
  console.log("Меню открыто:", isSideMenuOpen);

  return (
    <div>
      {isAuthenticated ? <AuthenticatedMenu toggleMenu={toggleMenu} toggleTheme={toggleTheme} name={name} isSideMenuOpen={isSideMenuOpen} /> : <UnauthenticatedMenu toggleMenu={toggleMenu} toggleTheme={toggleTheme} />}
    </div>
  );
};
export default Header;
